// 1957. Delete Characters to Make Fancy String
/*
A fancy string is a string where no three consecutive characters are equal.

Given a string s, delete the minimum possible number of characters from s to make it fancy.

Return the final string after the deletion. It can be shown that the answer will always be unique.

 

Example 1:

Input: s = "leeetcode"
Output: "leetcode"
Explanation:
Remove an 'e' from the first group of 'e's to create "leetcode".
No three consecutive characters are equal, so return "leetcode".
*/

const makeFancyString = function (s) {
  let arrayy = s.split("");
  let i = 0;

  while (i < arrayy.length - 1) {
    if (arrayy[i] === arrayy[i + 1] && arrayy[i + 2] === arrayy[i]) {
      arrayy.splice(i + 2, 1);
      i = Math.max(i - 1, 0);
    } else {
      i++;
    }
  }
  let word = arrayy.join("");
  return word;
};

console.log(makeFancyString("leeetcode"));
console.log(makeFancyString("aaabaaaa"));
console.log(
  makeFancyString(
    ""
  )
);

// my code works, but it exceeds the time limit on leetcode for very very large strings
// then i got this optimized solution from the internet

const makeFancyStringg = function (s) {
  let result = [];
  for (let i = 0; i < s.length; i++) {
    // Add the character to the result only if it doesn't form three consecutive characters
    if (
      result.length < 2 ||
      !(
        result[result.length - 1] === s[i] && result[result.length - 2] === s[i]
      )
    ) {
      result.push(s[i]);
    }
  }
  return result.join("");
};

// Test Cases
console.log(makeFancyStringg("leeetcode"));
console.log(makeFancyStringg("aaabaaaa"));
console.log(makeFancyStringg("aab"));
console.log(
  makeFancyStringg(
    ""
  )
);
